import React, { Component } from 'react';

const TestingList = (props) =>{
    return (
        <li>
          <a href="#" onClick={ () => {
            props.clickHandler(props.index)
          }} className={props.info.completed ? 'active' : ''}>
          {props.info.name}
          </a>
        </li>
      )
}

  export default TestingList;
